import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Vinland from './Page/Vinland';
import Miror from './Page/Miror';
import DemonSlayer from './Page/DemonSlayer';
import navBar from './components/navBar'
import './App.css';


function App() {
  return (
    <Router>
      <navBar />
      <Routes>
        <Route path="/vinland" element={<Vinland />} />
        <Route path="/miror" element={<Miror />} />
        <Route path="/demonSlayer" element={<DemonSlayer />} />
      </Routes>
    </Router>
  );
}

export default App;
